const { width, height } = Dimensions.get("window");

// import { prepare } from "./PathAlongGradient";

export const prepare = (svg: string) => {
  const path = Skia.Path.MakeFromSVGString(svg)!;
  const src = path.computeTightBounds();
  const dst = rect(0, 0, width, height);
  const m3 = fitRect(src, dst);
  path.transform(m3);
  return { path, totalLength: 0, lines: [] };
};

export interface Line {
  p1: Vector;
  p2: Vector;
  length: number;
  paint: SkPaint;
}

interface GradientAlongPathProps {
  path: SkPath;
  totalLength: number;
  lines: Line[];
  progress: SharedValue<number>;
}

export const GradientAlongPath = ({
  path,
  progress,
  lines,
  totalLength,
}: GradientAlongPathProps) => {
  return (
    <Group>
      <Path
        path={path}
        color={"#6F4D38"}
        end={progress}
        style={"fill"}
        // strokeWidth={7}
      />
    </Group>
  );
};

